import React from "react";

import Audio from "./Audio";

export default function Phonetic(props) {
  console.log(props.phonetic);

  return (
    <div className="Phonetic">
      {props.phonetic.text}
      <br />
      {props.phonetic.audio.map(function (audio, index) {
        return (
          <div key={index}>
            <Audio audio={audio} />
          </div>
        );
      })}
    </div>
  );
}
